import React, {Component} from 'react';
import axios from 'axios';
import './App.css';

class App extends Component {

    componentWillMount() {
        this.setState({
            show: false
        })
    }

    // componentDidMount() {
    //     this.setState({
    //         show: false
    //     })
    // }

    onClick = async () => {
        const response = await axios.get('http://localhost:8080/shortestPath/maxDistance/C/C/30');
        console.log(response);
        this.setState({
            items: response.data,
            show: true
        })
    }


    render() {
        return (
            <div className="App">
                <header className="App-header">
                    <h1>Welcome to ThoughtWorks Train Manage System!</h1>
                </header>
                <main>
                    <button onClick={ () => this.onClick() }>Test</button>
                    {this.state.show ? <p>{this.state.items}</p> : null}
                </main>
            </div>
        );
    }
}

export default App;
